import React, { Component } from "react";
import { Grid, Cell, List, ListItem, ListItemContent } from "react-mdl";
import social1 from "../github.png";
import social2 from "../netlify.png";
import social3 from "../gmail.png";
import social from "../linkedin.png";

class about extends Component {
  render() {
    return (
      <div className="contact-body">
        <button>
          <img
            className="social1"
            src={social1}
            alt="logo...."
            a
            href="https://github.com/twentymurial33"
          />
        </button>
        <button>
          <img
            className="social2"
            src={social2}
            alt="logo...."
            a
            href="https://app.netlify.com/teams/twentymurial33/overview"
          />
        </button>
        <button>
          <img
            className="social2"
            src={social3}
            alt="logo...."
            a
            href="https://mail.google.com/mail/u/0/?tab=km#inbox"
          />
        </button>
        <button>
          <img
            className="social2"
            src={social}
            alt="logo...."
            a
            href="https://mail.google.com/mail/u/0/?tab=km#inbox"
          />
        </button>
      </div>
    );
  }
}

export default about;
